  render() {

    const tableRows = this.state.data.map((entry) => {
      let row = null;
      for (let k in elt) {
        row += <td data-key={k}>{elt[k]}</td>;
      }
      return (<tr>${row}</tr>)
    })

    return (
      <div>Use the Force!<br />
        <table>
          <thead>
            <th colspan="10">Star wars Data</th>
          </thead>
          <tbody>
            {tableRows}
          </tbody>
        </table>
      </div>
    );
  }
}

export default StarWarsDB;
